import { BrowserRouter, Route, Routes } from "react-router-dom"
import Header from "./componat2/Header"
import Slider from "./componat2/Slider"

function App(){
    return(
<div>
    <BrowserRouter>
    <Routes>
        <Route path="Home" element={
<>
<Header/>
    <Slider/>
</>
        }></Route>
    </Routes>
    
    </BrowserRouter>
</div>
    )
}
export default App
